import {Component } from '@angular/core';
import {ClienteService} from "../../../services/cliente.service";
import {ActivatedRoute, Router} from "@angular/router";
import {ClienteCl} from "../../../interfaces/cliente-cl";

@Component({
  selector: 'app-component-client',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponentClient  {

  cedula : number = 0;
  constructor(    private clienteService: ClienteService, private router: Router, private route : ActivatedRoute) {
  }
  cliente : ClienteCl | undefined;
  checkLogin(){
    console.log(this.cedula);
    this.clienteService.loginCLiente(this.cedula).subscribe((res) => {
      if(res){
        this.cliente = res;
        this.router.navigate(['/mascotas-cliente'], {queryParams: { id: this.cliente?.id}});
      }else{
        alert('Cedula incorrecta');
      }
    });
  }
}
<main>
  <div id="clouds-container">
    <div id="cloud1" class="clouds">
      <img src="./assets/landing/cloud1.png" alt="cloud">
    </div>
    <div id="cloud2" class="clouds">
      <img src="./assets/landing/cloud4.png" alt="cloud">
    </div>

    <div id="dog">
      <img src="./assets/landing/dog.png" alt="dog">
    </div>
  </div>
  <div id="logins">
    <div class="forms">
      <h1 class="registrar">Ingresar</h1>
      <form  (ngSubmit)="checkLogin()">
        <div>
          <input [(ngModel)]="cedula" type="text" id="cedula" name="cedula" placeholder="Cédula" required minlength="10" >
        </div>
        <div class="button-registrar">
          <button class="button-registrar2" type="submit">Ingresar</button>
        </div>
      </form>

      <p class="sin-cuenta">No tienes cuenta? <a href="/registro-c">Registrate</a></p>

    </div>
  </div>

</main>
